description:
Eagle Eye (2008)  

Verenigde Staten
Actie / Thriller
118 minuten

geregisseerd door D.J. Caruso
met Shia LaBeouf, Rosario Dawson en Michelle Monaghan

De tiener Jerry (Shia LaBeouf) en de alleenstaande moeder Rachel (Michelle Monaghan) worden door een groep terroristen gevangen genomen. Deze groep terroristen verwikkelt de twee in een plot waarin ze gedwongen worden om de president te vermoorden. De twee zullen vechten om het niet zover te laten komen, maar aangezien de terroristen het zoontje van Rachel hebben lijkt het dat ze niet veel keus hebben.

